import * as React from 'react';
import withStyles from "@material-ui/core/styles/withStyles";
import Button from "@material-ui/core/Button";
import ButtonGroup from '@material-ui/core/ButtonGroup';
import Card from '@material-ui/core/Card';
import Typography from '@material-ui/core/Typography';
import CardContent from '@material-ui/core/CardContent';
import { useQuery } from '@apollo/react-hooks';
import gql from "graphql-tag";


export const styles = theme => ({
    componentContainer: {
        display: 'flex',
    },
    buttonGroup: {
        width: 180,
        marginRight: 200,
    },
    button: {
        fontSize: 'smaller',
        borderColor: '#fff',
        color: '#fff',
        background: '#550055',
        height: 60,
        justifyContent: 'center',
        '&:hover': {
            background: '#310131',
        },
    },
    card: {
        width: 800,
        height: 800,
    }
});





class GraphAPI extends React.Component {

    state = {

    };

    constructor(props) {
        super(props);

    }

    componentDidMount() {
    }

    render() {
        const {classes} = this.props;

        const { data, loading, error } = useQuery(GET_POKEMON_INFO);

        if (loading) return <p>Loading...</p>;
        if (error) return <p>Error</p>;

        console.log(document.cookie);

        return (
            <React.Fragment>
                <div className={classes.componentContainer}>
                    <ButtonGroup
                        className={classes.buttonGroup}
                        orientation="vertical"
                        aria-label="vertical outlined primary button group"
                    >
                        <Button className={classes.button}>Button 1</Button>
                        <Button className={classes.button}>Button 2</Button>
                        <Button className={classes.button}>Button 3</Button>
                        <Button className={classes.button}>Button 4</Button>
                    </ButtonGroup>
                    <Card className={classes.card}>
                        <CardContent>
                            <Button className={classes.button} onClick={this.handleClick(data)}/>
                        </CardContent>
                    </Card>
                </div>
            </React.Fragment>
        );
    }

    handleClick(data) {
        console.log(data)
    }

}

export default withStyles(styles)(GraphAPI);
